
public class ComOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.print((3==4) + " ");
		System.out.print((3!=4) + " ");
		System.out.print((3>4) + " ");
		System.out.print((4>3) + " ");
		
		
		System.out.print((3==3 && 4==7) + " ");
		System.out.print((3==3 || 4==7) + " ");

	}

}
